import Home from ".";
import Layout from "../components/layout";

export default function Sign({ children, serverUrl }) {
  return (
    <Layout home>
      <Home />
    </Layout>
  )
}

export async function getStaticProps(ctx) {
  return {
    props: {
      serverUrl: process.env.SERVER
    }
  }
}
